chrome.runtime.onMessage.addListener(function backgroundListener(request, sender, sendResponse) {
   var doc = slideWidth>slideHeight?new jsPDF('l', 'pt', [slideWidth, slideHeight]):new jsPDF('p', 'pt', [slideWidth, slideHeight]);
   var slideImgsData = request.response;
   for(var j = 0; j < slideImgsData.length; j++){
      if(j!=0)
      doc.addPage();
      doc.addImage(slideImgsData[j], 'JPEG', 0, 0, slideWidth, slideHeight);
   }
   // doc.save(title + '.pdf');
   let pptx = new PptxGenJS();
   pptx.defineLayout({ name:'current', width:slideWidth/96, height:slideHeight/96 });
   pptx.layout = 'current';
   for(var j = 0; j < slideImgsData.length; j++){
      pptx.addSlide().addImage({ data: slideImgsData[j], w: slideWidth/96, h: slideHeight/96});
   }
   pptx.writeFile({ fileName: title });
});